    condition: {
        faker: 'helpers.randomize(["email", "user"])'
    },
    'object.condition==="email",show': {
        static: 'email'
    },
    'object.condition==="user",show': {
        static: 'user'
    },
    'object.condition==="email",email': {
        hasOne: 'emails'
    },
    'object.condition==="user",user': {
        hasOne: 'users'
    }
}

